  false,\n\t\"url\": null,\n\t\"notes\": \"The Light Detection and Ranging (LiDAR)
  dataset is a survey of Suwannee River G13PD00141 1.0 Meter LiDAR Survey Area 3,
  Classified Point Cloud, in north-central Florida and encompasses 45 square miles.
  The LiDAR point cloud was flown at a nominal post spacing of 1.0 meters for unobscured
  areas. The LiDAR data and derivative products produced are in compliance with the
  U.S. Geological Survey National Geospatial Program Guidelines and Base Specifications,
  Version 1. The flight lines were acquired by Digital Aerial Solutions, LLC. between
  Feb. 04, 2013 and Feb. 15, 2013. Derivative products from the aerial acquisition
  include: Raw point cloud data in LAS v1.2, classified point cloud data in LAS v1.2,
  bare earth surface tiles (raster DEM ESRI float GRID format), bare earth surface
  DEMs mosaic (raster DEM MrSID format), control points, project report, and FGDC
  compliant XML metadata.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
